import { SVGProps } from "react";

type IconCloudProps = SVGProps<SVGSVGElement> & { size?: number };

export const IconCloud = ({ size = 1, ...rest }: IconCloudProps) => {
  return (
    <svg
      width={897 * size}
      height={874 * size}
      viewBox="0 0 897 874"
      fill=""
      xmlns="http://www.w3.org/2000/svg"
      {...rest}
    >
      <image
        id="background"
        width="897"
        height="874"
        opacity="0.464"
        xlinkHref="data:image/png;base64,"
      />
    </svg>
  );
};
